import React from "react";
import { Outlet } from "react-router-dom";
import {Main} from '../../Components/Main'
import {Topbar} from '../../Components/Topbar'
import { Sidebar } from "../../Components/Sidebar";

const MainLayout = () => {
  return (
    <div>
      <Topbar />
      <div>
        <Sidebar />
        <Main>
          <Outlet />
        </Main>
      </div>
    </div>
  );
};

export { MainLayout };
